H_initialValue:
Observer { outerEvent in
				if !isInLoop {
					isInLoop = true
					innerObserver.send(outerEvent)

					while !eventQueue.isEmpty {
						innerObserver.send(eventQueue.removeLast())
					}

					isInLoop = false
				} else {
					eventQueue.insert(outerEvent, at: 0)
				}
			}

self.observe { event in
				switch event {
				case .completed:
					break

				case .value, .failed, .interrupted:
					observer.send(event)
				}
			}

state.modify { state -> Value? in
						guard !state.isTerminated else { return nil }

						if shouldThrottle {
							state = .throttled(nil)
						} else {
							defer { state = .resumed }

							if case let .throttled(value?) = state {
								return value
							}
						}

						return nil
					}

Strategy(count: builder.startHandlers.count) { event in
				switch event {
				case let .value(value):
					observer.send(value: transform(value))
				case .completed:
					observer.sendCompleted()
				}
			}
